import React from 'react';
import {Button} from 'react-bootstrap';
import {FormControl} from 'react-bootstrap';
import {FormGroup} from 'react-bootstrap';
import {Col} from 'react-bootstrap';
import {Form} from 'react-bootstrap';
import {ControlLabel} from 'react-bootstrap';
import axios from 'axios';



class AdminLogin extends React.Component{
    constructor(){
        super();
        this.password=React.createRef();
        this.email=React.createRef();
    }



    render(){
        return(
            <Form method="post" action="http://localhost:3002" horizontal>
  <FormGroup controlId="formHorizontalEmail">
    <Col componentClass={ControlLabel} sm={2}>
      Email
    </Col>
    <Col sm={10}>
      <FormControl ref={this.email} type="email" placeholder="Email" />
    </Col>
  </FormGroup>

  <FormGroup controlId="formHorizontalPassword">
    <Col componentClass={ControlLabel} sm={2}>
      Password
    </Col>
    <Col sm={10}>
      <FormControl ref={this.password} type="password" placeholder="Password" />
    </Col>
  </FormGroup>

  <FormGroup>
    <Col smOffset={2} sm={10}>
      <Button onClick={this.login} type="submit">Sign in</Button>
    </Col>
  </FormGroup>
</Form>
        )
    }
}
export default AdminLogin;
